import React from 'react';
import { Routes, Route } from 'react-router-dom';
import TestComponent from './components/TestComponent.js';

function App() {
  return(
    <>
      <Routes>
        <Route path="/" component={<TestComponent/>} />
      </Routes>
    </>
  )
}

export default App;
